import React from 'react';
import Logo from '../assets/PalmtreeLeftLogo.webp';
import {Link} from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-gray-900 text-gray-300 py-4 sticky top-0 z-50">
      <div className="container mx-auto px-4 flex flex-col md:flex-row items-center justify-between">

        {/* Brand Title */}
        <div className="flex-1 text-center md:text-left mb-4 md:mb-0">
          <Link to="/" className="hover:cursor-pointer">
            <h1 className="text-3xl md:text-4xl font-bold text-cyan-500 hover:text-cyan-900">
              <span className="font-custom text-4xl md:text-5xl">3</span>D Model Maker
            </h1>
          </Link>
          <p className="text-sm md:text-base text-gray-400">by Shoreline Consulting</p>
        </div>

        {/* Logo and Link */}
        <div className="flex flex-col items-center md:flex-row md:space-x-4">
          <a href="https://creativecoloring.io/" target="_blank" rel="noopener noreferrer">
            <img
              src={Logo}
              alt="Akira Web Solutions Logo"
              className="h-10 w-10 md:h-12 md:w-12 rounded-xl"
            />
          </a>
          <a
            href="https://akirawebsolutions.com"
            target="_blank"
            rel="noopener noreferrer"
            className="mt-2 md:mt-0 text-white hover:text-cyan-300 text-sm md:text-base"
          >
            Visit Us
          </a>
        </div>
      </div>
    </header>
  );
};

export default Header;
